import React, { useState, useEffect } from "react";
import "./App.css";
import { BrowserRouter as Router } from "react-router-dom";
import Loading from "./components/Preloader/Loading";
import axios from "axios";
import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import Pageone from "./components/Pageone/Pageone";
import Appinfo from "./components/Pageone/Apiinfo";
import { getNasaPics } from "./components/Pageone/Apiinfo";

function App() {
  const [loading, setloading] = useState(false);
  const [Post, setPost] = useState([]);
  const [isOpen, setIsOpen] = useState(false);
  const [data, setData] = useState([]);

  const toggle = () => {
    setIsOpen(!isOpen);
  };

  useEffect(() => {
    setloading(true);
    setTimeout(() => {
      setloading(false);
    }, 0);
  }, []);

  const [coins, setCoins] = useState([]);
  const [search, setSearch] = useState("");

  useEffect(() => {
    axios
      .get(
        "https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?earth_date=2015-6-3&api_key=C0AhMKBPXqpPU9pZrHZjgu5oTmINIkBrrdHwNL2T"
      )
      .then((res) => {
        setCoins(res.data);
        console.log(res.data);
      })
      .catch((error) => console.log(error));
  }, []);

  const filteredCoins = coins.filter((coin) => coin.id.toLowerCase());

  return (
    <Router>
      <>
        {loading ? (
          <>
            <Loading />
          </>
        ) : (
          <>
            <Sidebar isOpen={isOpen} toggle={toggle} />
            <Navbar toggle={toggle} />
            <Pageone />
            {filteredCoins.map((coin) => {
              return (
                <h1
                  key={coin.id}
                  name={coin.name}
                  price={coin.current_price}
                  symbol={coin.symbol}
                  marketcap={coin.total_volume}
                  volume={coin.market_cap}
                  image={coin.image}
                  priceChange={coin.price_change_percentage_24h}
                >
                  {coin.id}
                </h1>
              );
            })}
          </>
        )}
      </>
    </Router>
  );
}

export default App;
